import React from "react";
import './Table.css'

function Table(){
    return(
        <div className="table_block">
             <img src="table_image.png" alt="Table Image" class="table_image" />
             <div className="moves_block">
                <img src="moves_button"/>
             </div>
        </div>
    );
}
export default Table;
